There's just one day to go to the greatest pop giveaway in newspaper history

And its clear millions of fans are every bit as excited as we are about Princes
new 20TEN album available FREE and EXCLUSIVELY with Saturdays Daily
Mirror.

Our unbelievable offer has made headline news across the globe from
Argentina to Australia and from Japan to the US, where it has featured on
top TV networks such as CNN and ABC.

Meanwhile, the superstars fans have gone crazy with anticipation on internet
forums and Twitter over what 20TEN will sound like.

Many devotees from all over the world have sent phonelines at the Mirrors
offices into meltdown as they try to find out how they can get their hands on
a copy.

If youre in the UK, theres only one way to grab the years most awaited CD
by buying a copy of tomorrows Mirror for one of more than 2.5 million copies
of the album we are giving away free.

Remember that 20TEN will be available for one day only and cannot be
bought in shops or downloaded anywhere. Earlier this week the reclusive
star, 52, told of his delight at his historic collaboration with the Mirror.

Get your free copy of the new Prince album 20TEN exclusive with the Daily
Mirror on Saturday 10 July Free Prince 20TEN



